(1, 'logo', '170928_cb719e64.png', '2017-09-28 08:41:28', '2017-09-28 08:41:28'),
(2, 'content', '&lt;p&gt;This is IW magazine, a bimonthly publication that brings the readers all about aesthetics of living space and contemporary design mode. Our reports include architecture, interior and industrial style, current art exhibition and design of furniture and decoration.&lt;/p&gt;&lt;p&gt;If you may provide pictures and/or articles about the above information. Please contact us by Email or fax, Thank you.&lt;/p&gt;&lt;p&gt;IW magazine No. 14, Ln.292, Lung Chiang Rd., Taipei 10477, Taiwan Tel: 886-2-2504-8388 Fax: 886-2-2504-2687 Email: &lt;a href=&quot;mailto:info@iw-magazine.com&quot;&gt;info@iw-magazine.com&lt;/a&gt; Website: &lt;a href=&quot;http://www.iw-magazine.com&quot;&gt;www.iw-magazine.com&lt;/a&gt;&lt;/p&gt;&lt;p&gt;傢飾雜誌是一份報導生活間美學，反應設計時尚的雙月刊雜誌。舉凡建築、室內設計、當代藝術展覽、傢俱傢飾設計，均在我們報導之列；歡迎提供以上相關照片、文字資料，以電子郵件或傳真與傢飾聯繫。&lt;/p&gt;&lt;p&gt;傢飾雜誌 台北市10477中山區龍江路292巷14號 廣告客戶暨讀者服務熱線: 02-2504-8388 二十四小時開放傳真熱線: 02-2504-2667 電子信箱:&amp;nbsp;&lt;a href=&quot;mailto:info@iw-magazine.com&quot;&gt;info@iw-magazine.com&lt;/a&gt;&amp;nbsp;網址:&amp;nbsp;&lt;a href=&quot;http://www.iw-magazine.com&quot;&gt;www.iw-magazine.com&lt;/a&gt;&lt;/p&gt;', '2017-09-28 08:41:28', '2017-09-28 08:41:28');
